import React, { useEffect, useState } from "react";
import { Navigate } from "react-router-dom";
import axios from "axios";
import './Configuration.css';
import Modal from '@material-ui/core/Modal';

function Configuration({ userId }) {
  const [open, setOpen] = React.useState(false);
  const [buildingType, setBuildingType] = useState("");
  const [buildingCost, setBuildingCost] = useState("");
  const [constructionTime, setConstructionTime] = useState("");
  const [configurations, setConfigurations] = useState([]); // State to store configurations

  const buildingTypes = ["Farm", "Academy", "Headquarters", "LumberMill", "Barracks"];

  const handleClose = () => {
    setOpen(false);
  };

  const handleOpen = () => {
    setOpen(true);
  };

  const handleCreateConfiguration = () => {
    if (!buildingType.trim() || !buildingCost.trim() || !constructionTime.trim()) {
        alert("Please fill in all fields.");
        return;
    }

    const data = {
      UserId: userId,
      BuildingType: buildingType,
      BuildingCost: parseFloat(buildingCost),
      ConstructionTime: parseFloat(constructionTime),
    };

    axios.post("https://localhost:44388/api/Auth/CreateConfiguration", data)
      .then((response) => {
        alert("Configuration created successfully");
        handleClose();
        // Reload configurations after creating one
        loadConfigurations();
      })
      .catch((error) => {
        alert("Error creating configuration: " + error.message);
      });
  };

  // Function to load configurations from the API
  const loadConfigurations = () => {
    axios.get(`https://localhost:44388/api/Auth/ListConfigurations/${userId}`)
    .then((response) => {
        setConfigurations(response.data);
      })
      .catch((error) => {
        alert("Error loading configurations: " + error.message);
      });
  };

  useEffect(() => {
    loadConfigurations(); // Load configurations when the component mounts
  }, []);

  const token = localStorage.getItem('token');
  if (!token) {
    return <Navigate to="/login" />;
  }

  return (
    <div>
      <h2>Configuration Page</h2>
      <table>
        <thead>
          <tr>
            <th>#</th>
            <th>Building Type</th>
            <th>Building Cost</th>
            <th>Construction Time</th>
          </tr>
        </thead>
        <tbody>
          {configurations.map((config, index) => (
            <tr key={config.id}>
              <td>{index + 1}</td>
              <td>{config.buildingType}</td>
              <td>{config.buildingCost}</td>
              <td>{config.constructionTime}</td>
            </tr>
          ))}
        </tbody>
      </table>
      <div style={{ display: 'block', padding: 30 }}>
        <button type="button" onClick={handleOpen}>
          Add Building
        </button>
        <Modal
          onClose={handleClose}
          open={open}
          style={{
            position: 'absolute',
            border: '2px solid #000',
            backgroundColor: 'gray',
            boxShadow: '2px solid black',
            height: 240,
            width: 720,
            margin: 'auto'
          }}
        >
          <div style={{ padding: '16px' }}>
            <div className="row">
              <label>Building Type</label>
              <select onChange={(e) => setBuildingType(e.target.value)}>
                <option value="">Select Building Type</option>
                {buildingTypes.map((type) => (
                  <option key={type} value={type}>
                    {type}
                  </option>
                ))}
              </select>
            </div>
            <div className="row">
              <label>Building Cost</label>
              <input type="text" onChange={(e) => setBuildingCost(e.target.value)} />
            </div>
            <div className="row">
              <label>Construction Time</label>
              <input type="text" onChange={(e) => setConstructionTime(e.target.value)} />
            </div>
            <div className="row">
              <button onClick={handleCreateConfiguration}>Create Configuration</button>
            </div>
          </div>
        </Modal>
      </div>
    </div>
  );
}

export default Configuration;
